import React from "react";
import mewthree from '../assets/images/Mewthree.png'

const Mewthree = () => {
    return(
        <div>
            <p>OH MY FUCKING GOD</p>
            <img src={mewthree} alt="" />
        </div>
    )
}

export default Mewthree
